/// Solution to Just Primes Problem (https://www.spoj.com/problems/JPM/)

fn generate_primes_up_to(number: usize) -> Vec<u32> {

    let mut primes = Vec::new();

    let mut prime_flags = vec![0; number + 1];
    let number_sqrt = (number as f64).sqrt() as usize + 1;
    for value in 2..number_sqrt {
        if prime_flags[value] == 0 {
            primes.push(value as u32);
        }
        else {
            continue;
        }

        let mut value_multiples = value * value;
        while value_multiples < number + 1 {
            prime_flags[value_multiples] = 1;
            value_multiples += value;
        }
    }

    for value in number_sqrt..number + 1 {
        if prime_flags[value] == 0 {
            primes.push(value as u32);
        }
    }
    return primes;
}

fn read_line_to_usize() -> usize {
    let mut string = String::new();
    let _ = std::io::stdin().read_line(&mut string);
    return string.trim().parse().expect("Input not an unsigned integer");
}

fn compute_minimum_primes_count(primes: &Vec<u32>, number: usize) -> Vec<u32> {

    let mut dp = vec![vec![std::u32::MAX; primes.len()]; number + 1 ];

    if number < primes[0] as usize {
        return vec![std::u32::MAX];
    }

     dp[2][0] = 1;

    let mut result = vec![std::u32::MAX; number + 1];

    for number_idx in 2..number + 1 {
        for prime_idx in 1..primes.len() {
            if number_idx as u32 == primes[prime_idx] {
                dp[number_idx][prime_idx] = 1;
                continue;
            }

            dp[number_idx][prime_idx] = dp[number_idx][prime_idx - 1];

            if number_idx as u32 >= 2 + primes[prime_idx] && dp[number_idx - primes[prime_idx] as usize][prime_idx - 1] != std::u32::MAX {
                dp[number_idx][prime_idx] = std::cmp::min(
                    dp[number_idx - primes[prime_idx] as usize][prime_idx - 1] + 1,
                    dp[number_idx][prime_idx]
                );
            }
        }
        result[number_idx] = dp[number_idx][primes.len() - 1];
    }
    return result;
}

fn main() {
    let tests_count = read_line_to_usize();

    let precomputed_counts_offset = 3500;
    let zero_byte_value = 48;
    let primes = generate_primes_up_to(precomputed_counts_offset);
    let results = compute_minimum_primes_count(&primes, precomputed_counts_offset);

    let counts_as_bytes = COUNTS.as_bytes();
    for test_id in 0..tests_count {

        let number = read_line_to_usize();

        if number >= precomputed_counts_offset {
            let result = counts_as_bytes[number - precomputed_counts_offset] - zero_byte_value;
            println!("Case {test_id}: {result}", test_id=test_id + 1, result=result);
        }
        else {
            let result = results[number];
            if result == std::u32::MAX {
                println!("Case {test_id}: -1", test_id=test_id + 1);
            }
            else {
                println!("Case {test_id}: {result}", test_id=test_id + 1, result=result);
            }
        }
    }
}

static COUNTS: &str = "";